import { configureStore } from "@reduxjs/toolkit"
import dataReducer from "../features/dataSlice"
import dataPizzaReducers from "../features/dataPizzaSlice"

export const store = configureStore({
    reducer: {
        data: dataReducer,
        getData: dataPizzaReducers
    }
})
